import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          Hi, <br>I'm Tsione, </br>
          <br>Web developer </br>
        </h1>
        <p>Full-Stack Developer/ Front End Developer/ Back End Developer </p>
      </header>
    </div>
  );
}

export default App;
